    false,nt"url": null,nt"notes": "This dataset consists of the vector digital
    GIS files that were used to create sheet 1 of the "Preliminary volcano-hazard assessment
    for Okmok Volcano, Umnak Island, Alaska" (DGGS RI 2004-3). The map area is centered
    around Okmok Volcano, on eastern Umnak Island. The data includes volcano-hazard
    zones for ballistics, ash accumulation, pyroclastic flows, floods and lahars, and
    debris avalanches. Also included in the dataset are roads, trails, seismic station
    locations, continuous GPS station locations, creeks, and the location of the Fort
    Glenn airstrip.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
